import React, { useState } from 'react';
import axios from 'axios';
import './ClockIn.css';

function ClockIn() {
  const [employeeId, setEmployeeId] = useState('');
  const [enclosureData, setEnclosureData] = useState({
    enclosureId: '',
    name: '',
    type: '',
    buildDate: '',
    address: '',
    cleaningStartTime: '',
    cleaningEndTime: ''
  });
  const [clockInTime, setClockInTime] = useState(null);
  const [clockOutTime, setClockOutTime] = useState(null);
  const [message, setMessage] = useState('');

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setEnclosureData({
      ...enclosureData,
      [name]: value
    });
  };

  const handleClockIn = async () => {
    try {
      await axios.post('/clock-in', { employeeId });
      setClockInTime(new Date());
      setMessage('Clock-in successful');
    } catch (error) {
      console.error('Clock-in error:', error);
      setMessage('Clock-in failed');
    }
  };

  const handleClockOut = async () => {
    try {
      await axios.post('/clock-out', { employeeId });
      setClockOutTime(new Date());
      setMessage('Clock-out successful');
    } catch (error) {
      console.error('Clock-out error:', error);
      setMessage('Clock-out failed');
    }
  };

  const calculateHoursWorked = () => {
    if (clockInTime && clockOutTime) {
      const diff = Math.abs(clockOutTime - clockInTime);
      const hours = Math.floor(diff / (1000 * 60 * 60));
      const minutes = Math.floor((diff % (1000 * 60 * 60)) / (1000 * 60));
      return `${hours} hours and ${minutes} minutes`;
    }
    return 'N/A';
  };

  return (
    <div className='clock-in'>
      <h1>Employee Clock In/Out</h1>
      <div>
        <label>
          Employee ID:
          <input type="text" value={employeeId} onChange={(e) => setEmployeeId(e.target.value)} />
        </label>
      </div>
      <div>
        <label>
          Enclosure ID:
          <input type="text" name="enclosureId" value={enclosureData.enclosureId} onChange={handleInputChange} />
        </label>
      </div>
      <div>
        <label>
          Name:
          <input type="text" name="name" value={enclosureData.name} onChange={handleInputChange} />
        </label>
      </div>
      <div>
        <label>
          Enclosure Type:
          <input type="text" name="type" value={enclosureData.type} onChange={handleInputChange} />
        </label>
      </div>
      <div>
        <label>
          Build Date:
          <input type="date" name="buildDate" value={enclosureData.buildDate} onChange={handleInputChange} />
        </label>
      </div>
      <div>
        <label>
          Address:
          <input type="text" name="address" value={enclosureData.address} onChange={handleInputChange} />
        </label>
      </div>
      <div>
        <label>
          Cleaning Start Time:
          <input type="time" name="cleaningStartTime" value={enclosureData.cleaningStartTime} onChange={handleInputChange} />
        </label>
      </div>
      <div>
        <label>
          Cleaning End Time:
          <input type="time" name="cleaningEndTime" value={enclosureData.cleaningEndTime} onChange={handleInputChange} />
        </label>
      </div>
      <div>
        <button onClick={handleClockIn}>Clock In</button>
        <button onClick={handleClockOut}>Clock Out</button>
      </div>
      <div>
        <p>Clock In Time: {clockInTime ? clockInTime.toLocaleString() : 'N/A'}</p>
        <p>Clock Out Time: {clockOutTime ? clockOutTime.toLocaleString() : 'N/A'}</p>
        <p>Total Hours Worked: {calculateHoursWorked()}</p>
      </div>
      {message && <p>{message}</p>}
    </div>
  );
}

export default ClockIn;
